import React, { useEffect, useState } from 'react';
import AOS from 'aos';
import Home from './components/Home';

function App() {
  useEffect(() => {
    AOS.init({ duration: 1000, once: true });
  }, []);

  return (
    <div className="App">
      <Home />
    </div>
  );
}

export default App;
